import React from "react";
import Infos from "./example_data.json";

const Test = () => {
  const info = Infos.map((item) => (
    <div key={item.id}>
      <p>{item.name}</p>
      <p>{item.categories}</p>
      <img src={item.profile_image_url} width="100" />
      <p>
        <img src={item.images} width="50" />
        <img src={item.images[1]} width="50" />
      </p>
      ==================================
    </div>
  ));

  const y = "2";
  return <div>{info}</div>;
};

export default Test;
